output_file = open(output_filename, "w")

# Write the CSV header
header = "File,Instance,NColoumns,Gap Threshold,RMP Runtime,Start Solution,Time Passed,Init Cols,Batch Pool Cols,SetUp Time First RMP,Columns IPB Start Solution,Max Columns in Solution,Min Columns in Solution,Max Columns in Model,IPB Iterations,CG Iterations,New Best Solution,Early CG Breaks,Columns IPB Final Solution,Best Integer Solution,LB RMP CURRENTBEST,Gap LBUB,Total Time Pricing,Avg Time Pricing,Avg Time CG,Total Time CG,Total Time Integer Solution,Avg Time Integer Solution, IPB Time Best Solution, START_SOLUTION_VALUE"
write(output_file, header * "\n")

# Write the table rows
for (file_name, data) in aggregated_data
    row = "$file_name,"
    row *= "$(data["Instance"]),"
    row *= "$(data["NCOLOUMNS"]),"
    row *= "$(data["GAP_THRESHOLD"]),"
    row *= "$(data["RMP_RUNTIME"]),"
    row *= "$(data["START_SOLUTION_IPB"]),"
    row *= "$(data["TotalTimePassed"]),"
    row *= "$(data["InitCols"]),"
    row *= "$(data["BatchPoolColumns"]),"
    row *= "$(data["SetUpTimeFirstRMP"]),"
    row *= "$(data["ColumnsIPBStartSolution"]),"
    row *= "$(data["MaxColumnsInSolution"]),"
    row *= "$(data["MinColumnsInSolution"]),"
    row *= "$(data["MaxColumnsInModel"]),"
    row *= "$(data["IPBIterations"]),"
    row *= "$(data["CGIterations"]),"
    row *= "$(data["NewBestSolution"]),"
    row *= "$(data["EarlyCGBreaks"]),"
    row *= "$(data["ColumnsIPBFinalSolution"]),"
    row *= "$(data["BestIntegerSolution"]),"
    row *= "$(data["LB_RMP_CURRENTBEST"]),"
